// InboxPage.js

import React from 'react';
import './InboxPage.css';

const InboxPage = () => {
  return (
    <div className="inbox-container">
      <aside className="menu-sidebar">
        {/* Menu Sidebar Items */}
        <Link to="/" className="menu-item">Home</Link>
        <Link to="/compose" className="menu-item">Compose</Link>
        <Link to="/inbox" className="menu-item active">Inbox</Link>
        <Link to="/sent" className="menu-item">Sent</Link>
      </aside>
      <main className="inbox-content">
        <header className="welcome-header">
          <h1>Welcome! "Userâ€™s Name"</h1>
          <div className="search-bar">
            <input type="text" placeholder="Search file" />
          </div>
        </header>
        <section className="inbox-list">
          {/* Here you'd map over your inbox items */}
          <div className="inbox-item">
            <div className="sender">Hakiem</div>
            <div className="subject">Construction E-Invoice - This is your e-invoice for the construction</div>
          </div>
          {/* Repeat for other inbox items */}
        </section>
      </main>
    </div>
  );
};

export default InboxPage;
